import React from "react";

const NeedHelp = () => {
  return (
    <div class="container section small-padding">
      <div class="row">
        <div class="col-sm-12 cta">
          <p>Need help? Contact our support team on</p>
          <p class="gradient-text">0330 123 4567</p>
        </div>
      </div>
    </div>
  );
};

export default NeedHelp;
